$(function () {
    var vm = new Vue({
        el: '.container',
        data: {
            inputtext:{}
        },
        methods: {
            submit: function() {
                axios.post('/api/authentication', {
                    username: this.inputtext.username,
                    password: this.inputtext.password,
                    rememberMe: this.inputtext.rememberme
                })
                    .catch(function (error) {
                        console.log(error);
                    });
            }
        },
    })
});
